import { Box, Container, Paper, Typography } from "@mui/material";
import Navigation from "components/Navigation";
import React, { Component } from "react";
import Cards from "components/Cards";

class Home extends Component {
  render() {
    return (
      <Box
        sx={{
          // position: absolute;
          width: "auto%",
          height: "100%",
          // left: "0px",
          // top: "0px",
          background:
            "linear-gradient(180deg, rgba(0, 0, 0, 0.1) 0%, rgba(0, 0, 0, 0) 100%), linear-gradient(0deg, rgba(0, 0, 0, 0.4), rgba(0, 0, 0, 0.4)), url(../../assets/images/backgroundHome.jpg)",
        }}
        fixed
      >
        <Navigation />
        <Typography
          sx={{
            fontFamily: "Libre Baskerville",
            fontStyle: "normal",
            fontWeight: 400,
            fontSize: "98px",
            textAlign: "center",
            mt: 10,
          }}
        >
          Conquer the forest
        </Typography>
        <Typography
          sx={{
            fontStyle: "normal",
            fontWeight: 500,
            fontSize: "16px",
            mt: 10,
          }}
        >
          Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
          eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad
          minim veniam, quis nostrud exercitation
        </Typography>
        <Cards />
      </Box>
    );
  }
}

export default Home;
